import trovoLogo from "../../assets/logo/logo.png";
import trovoShopLogo from "../../assets/images/trovo-shop.png";

const Header = () => {
  return (
    <header>
      <div className="left-side">
        <img className="header__trovo-shop-logo" src={trovoShopLogo} />
      </div>
    </header>
  );
};

export default Header;
